import React, {useRef} from 'react';
import { useState } from 'react';
import { useAuth0 } from '@auth0/auth0-react';
import {firestore} from "../firebase"
import {addDoc, collection} from "@firebase/firestore"

function Body() {

    const { loginWithRedirect, logout, user, isAuthenticated } = useAuth0()
    const [name, setName] = useState();
    const [playerString, setPlayerString] = useState("");
    const [win, setWin] = useState();
    const [tie, setTie] = useState();
    const [loss, setLoss] = useState();
    const [formatError, setFormatError] = useState(false);

    const messageRef = useRef();
    const ref = collection(firestore, "Users");

    const handleConfirm = async(e) => {
        e.preventDefault();
        /*setName(e.target.value)
        console.log(messageRef.current.value);
        let data = {
            name: messageRef.current.value
        }
        try {
            addDoc(ref, data);
        } catch (e) {
            console.log(e);
        }*/
    }

    const handleUserInput = async(e) => {
        e.preventDefault();
        let players = playerString.split("\n");
        players = players.filter(elem => elem !== "");
        if (typeof win !== "number" || typeof tie !== "number" || typeof loss !== "number") {
            console.log("krivi format")
            setFormatError(true);
        } else {
            setFormatError(false);
        }
        console.log("Ime:" + name);
        console.log(players);
        console.log(win + "/" + tie + "/" + loss);
    }

    const handleNameChange = async (e) => {
        setName(e.target.value)
    }

    const handlePlayersChange = async (e) => {
        setPlayerString(e.target.value)
    }

    const handleWinChange = async (e) => {
        setWin(e.target.value)
    }

    const handleTieChange = async (e) => {
        setTie(e.target.value)
    }

    const handleLossChange = async (e) => {
        setLoss(e.target.value)
    }

    return(
        <>
        <div className="buttons-div">
            { !isAuthenticated ?
                <button id="login-button" onClick={() => loginWithRedirect()}>
                    Log in
                </button> : 
                <button id="logout-button" onClick={() => logout()}>
                    Log Out
                </button>
            }
        </div>
        { isAuthenticated ? 
            <div className="user-data">
               <form onSubmit={handleConfirm}>
                    <label>Type something:</label>
                    <input type="text" ref={messageRef} />
                    <button type="submit">Confirm</button>
                </form>
            </div> : "" }

            {
                isAuthenticated ?
                    <div className="logged-user-input">
                        <form>
                            <div className='form-div'>
                                <label>Naziv natjecanja</label>
                                <input type="text" id="name-input" onChange={handleNameChange}></input>
                            </div>
                            <div className='form-div'>
                                <label>Imena natjecatelja (svaki u novi redak) </label>
                                <textarea type="text" id="players-input" onChange={handlePlayersChange}></textarea>
                            </div>
                            <div className='form-div'>
                                <label>Sustav natjecanja (pobjeda / remi / poraz)</label>
                                <input type='text' id='system-input' onChange={handleWinChange}></input> / 
                                <input type='text' id='system-input' onChange={handleTieChange}></input> / 
                                <input type='text' id='system-input' onChange={handleLossChange}></input>
                            </div>
                            <button id="confirm-button" type="submit" onClick={handleUserInput}>Unesi</button>
                        </form> {
                            formatError && <div className='error'>Pogrešan unos formata, unesite samo brojke.</div>
                        }
                    </div>
                : ""
            }
        </>
    )

}

export default Body;
